import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 16.1-272.1 Claim of error to be raised within one year.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/16.1-272.1.md","filePath":"vacode/16.1-272.1.md"}'),o={name:"vacode/16.1-272.1.md"},i=a('<h1 id="§-16-1-272-1-claim-of-error-to-be-raised-within-one-year" tabindex="-1">§ 16.1-272.1 Claim of error to be raised within one year. <a class="header-anchor" href="#§-16-1-272-1-claim-of-error-to-be-raised-within-one-year" aria-label="Permalink to &quot;§ 16.1-272.1 Claim of error to be raised within one year.&quot;">​</a></h1><p>In addition to any other curative provisions, waivers, procedural defaults, or requirements for timely objection, including but not limited to those in subsection J of § <a href="http://law.lis.virginia.gov/vacode/16.1-241/" target="_blank" rel="noreferrer">16.1-241</a>, subsection E of § <a href="http://law.lis.virginia.gov/vacode/16.1-269.1/" target="_blank" rel="noreferrer">16.1-269.1</a> and subsection E of § <a href="http://law.lis.virginia.gov/vacode/16.1-269.6/" target="_blank" rel="noreferrer">16.1-269.6</a>, any claim of error or defect under this chapter, jurisdictional or otherwise, that is not raised within one year from the date of final judgment of the circuit court or one year from the effective date of this act, whichever is later, shall not constitute a ground for relief in any judicial proceeding.</p><p>2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0418" target="_blank" rel="noreferrer">418</a>.</p>',3),n=[i];function s(c,l,d,f,h,_){return r(),t("div",null,n)}const m=e(o,[["render",s]]);export{p as __pageData,m as default};
